    date_format_convert(str) {
        let date = str.toString().split(" ");
        const monthsShort = {
            Jan: '01',
            Feb: '02',
            Mar: '03',
            Apr: '04',
            May: '05',
            Jun: '06',
            Jul: '07',
            Aug: '08',
            Sep: '09',
            Oct: '10',
            Nov: '11',
            Dec: '12',
        };
        return [date[3], monthsShort[date[1]], date[2]].join("-");
    }
