    forPreviousValueSet() {
        if (this.index == 1) {
            this.physical_next();
        }
        else if (this.index == 2) {
            this.physical_next();
            this.life_next();
        }
        else if (this.index == 3) {
            this.physical_next();
            this.life_next();
            if (this.secondFormGroup.get('le_3')?.value == 'yes') {
                this.walking_next();
            }
        }
        else if (this.index == 4) {
            this.physical_next();
            this.life_next();
            if (this.secondFormGroup.get('le_3')?.value == 'yes') {
                this.walking_next();
            }
            this.mobility_next();
        }
    }
