    ageCalculator(dob) {
        let age;
        let now = new Date();
        let yearNow = now.getFullYear();
        let str = dob;
        let date;
        if (str) {
            date = str.toString().split("-");
            let dobYear = +date[0];
            age = yearNow - dobYear;
        }
        return age;
    }
